let img, canvas, ctx;
let xOffset = 0, yOffset = 0;
let w, h, dominant = 'height';
let cardImage = new Image();
cardImage.src = "data:image/png;base64,";

document.getElementById('imageInput').addEventListener('change', function(event) {
    const file = event.target.files[0];
    if (!file) return;

    document.querySelector('.controls').style.display = 'block';
    document.getElementById('downloadButton').style.display = 'inline-block';
    document.getElementById('toggleButton').style.display = 'inline-block';
    document.getElementById('cardCanvas').style.display = 'block';

    img = new Image();
    img.src = URL.createObjectURL(file);

    img.onload = function() {
        w = img.width;
        h = img.height;
        canvas = document.getElementById('canvas');
        ctx = canvas.getContext('2d');
        cropAndResize();
    };
});

document.getElementById('toggleButton').addEventListener('click', function() {
    dominant = dominant === 'height' ? 'width' : 'height';
    cropAndResize();
});

document.getElementById('upButton').addEventListener('click', function() {
    yOffset -= 10;
    cropAndResize();
});

document.getElementById('downButton').addEventListener('click', function() {
    yOffset += 10;
    cropAndResize();
});

document.getElementById('leftButton').addEventListener('click', function() {
    xOffset -= 10;
    cropAndResize();
});

document.getElementById('rightButton').addEventListener('click', function() {
    xOffset += 10;
    cropAndResize();
});

document.getElementById('downloadButton').addEventListener('click', function() {
    const link = document.createElement('a');
    link.download = 'cropped_resized_image.png';
    link.href = document.getElementById('output').src;
    link.click();
});

function cropAndResize() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    const hRatio = h / 531;
    const wRatio = w / 413;

    if (dominant === 'height' ? hRatio > wRatio : wRatio >= hRatio) {
        document.getElementById('leftButton').style.display = 'none';
        document.getElementById('rightButton').style.display = 'none';
        document.getElementById('upButton').style.display = 'inline';
        document.getElementById('downButton').style.display = 'inline';

        const newHeight = Math.floor(531 * w / 413);
        canvas.width = w;
        canvas.height = newHeight;
        ctx.drawImage(img, 0, (h - newHeight) / 2 + yOffset, w, newHeight, 0, 0, w, newHeight);
    } else {
        document.getElementById('upButton').style.display = 'none';
        document.getElementById('downButton').style.display = 'none';
        document.getElementById('leftButton').style.display = 'inline';
        document.getElementById('rightButton').style.display = 'inline';

        const newWidth = Math.floor(413 * h / 531);
        canvas.width = newWidth;
        canvas.height = h;
        ctx.drawImage(img, (w - newWidth) / 2 + xOffset, 0, newWidth, h, 0, 0, newWidth, h);
    }

    const resizedCanvas = document.createElement('canvas');
    resizedCanvas.width = 413;
    resizedCanvas.height = 531;
    const resizedCtx = resizedCanvas.getContext('2d');
    resizedCtx.drawImage(canvas, 0, 0, canvas.width, canvas.height, 0, 0, 413, 531);

    document.getElementById('output').src = resizedCanvas.toDataURL();

    setInterval(drawImageOnCard, 100);
}

function drawImageOnCard() {
    const cardCanvas = document.getElementById('cardCanvas');
    const cardCtx = cardCanvas.getContext('2d');

    const xCoord = parseFloat(document.getElementById('xCoord').value);
    const yCoord = parseFloat(document.getElementById('yCoord').value);
    const scaleRatio = parseFloat(document.getElementById('scaleRatio').value);

    cardCanvas.width = cardImage.width;
    cardCanvas.height = cardImage.height;

    cardCtx.drawImage(cardImage, 0, 0, cardCanvas.width, cardCanvas.height);

    const outputImg = document.getElementById('output');
    const aspectRatio = outputImg.width / outputImg.height;

    let overlayWidth, overlayHeight;

    if (aspectRatio >= 1) {
        overlayWidth = cardCanvas.width * scaleRatio;
        overlayHeight = overlayWidth / aspectRatio;
    } else {
        overlayHeight = cardCanvas.height * scaleRatio;
        overlayWidth = overlayHeight * aspectRatio;
    }

    const overlayX = xCoord * cardCanvas.width - overlayWidth / 2;
    const overlayY = yCoord * cardCanvas.height - overlayHeight / 2;

    cardCtx.clearRect(0, 0, cardCanvas.width, cardCanvas.height);

    cardCtx.drawImage(cardImage, 0, 0, cardCanvas.width, cardCanvas.height);

    cardCtx.drawImage(outputImg, overlayX, overlayY, overlayWidth, overlayHeight);
}
